script: |
  super -f text -I q9696.spq | sort > q9696.out

inputs:
  - name: q9696.spq
    data: |
      SELECT - tab1.col0 FROM tab1 (FORMAT parquet) WHERE NULL NOT BETWEEN + col0 - col0 AND col0 * + col1 * - col2 AND NULL BETWEEN ( NULL ) AND NULL;
  - name: tab1

outputs:
  - name: q9696.out
    data: |
